import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Home from '../components/Home';
import Container from '../containers/Container';

export default (
    <Switch>
        <Route exact path='/' component={ Home }/>
        <Route path='/carshoppingapi'/>
    </Switch>
);
